social_posts.post_text:
My head is still spinning from hearing the news that we have all lost such an incredible light and legend in the dance world. My thoughts keep going back to the making of this first Cheetah Girls Performance. I was able to bring a buddy I knew from college on as a choreographer, a young and fresh @sir_twitch_alot ! You recently had made your debut on the MTV dance show and there was no looking back, going on to SYTYCD, eventually win the hearts of millions on Ellen, and so much more through your undeniable talent! But what I’m remembering most today was your heart and kindness to anyone that wanted to dance during the days we were back at Chapman University. Whether it was downstairs in the dorms basement or at any event available to perform at on campus, you continued to grow your hip hop troop Shaka and encouraged anyone to join in. You just LOVED to dance and man we all loved watching you! And beyond that we were all so proud when your career took off! 

@sir_twitch_alot you have made your mark on this industry and in so many inspiring dancers lives over the years.  Your special gift will remain in our hearts forever and your passion for dance community will never be forgotten! Thank you for sharing your talent with the world! 

My heart goes out to @allisonholker  and your beautiful family and we will keep you in our prayers. ❤️🙏🏼
